import React from 'react'
import SignPage from './SignPage'
import {connect} from 'react-redux'
import {login} from '../../../redux/Test/authReducer'
class SignPageContainer extends React.Component{
render(){
    return(
        <SignPage login={this.props.login}  isAuth={this.props.isAuth}  />
    )
}
}

const mapStateToProps=(state)=>({
    isAuth:state.authtest.isAuth,
    errors:state.errortest
})
export default connect(mapStateToProps,{login})(SignPageContainer)
